export function repeatPasswordValidator(password ,repeatPassword) {
  if (!repeatPassword) return "Password can't be empty."
  if (repeatPassword.length < 5) return 'Password must be at least 5 characters long.'
  if (password !== repeatPassword) {
    return 'Passwords do not match';
  }
  return ''
}
